import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import useKeycloaks from './Keycloak'; // Import the useKeycloak hook
import reportWebVitals from './reportWebVitals';

const Root = () => {
  const keycloak = useKeycloak(); // Call the useKeycloak hook inside a functional component
  return (
    <React.StrictMode>
      <ReactKeycloakProvider authClient={keycloak}>
        <App />
      </ReactKeycloakProvider>
    </React.StrictMode>
  );
};

const rootElement = document.getElementById('root');
ReactDOM.createRoot(rootElement).render(<Root />); // Render the Root component

reportWebVitals();
